function SecondForm() {
  const {
    setHeightTwo,
    setWidthtTwo,
    setSecondtWindow,
    setSecondtDoor,
    heightTwo,
    widthtTwo,
  } = useContext(myContext);

  const handleHeight = ({ target: { value } }) => {
    setHeightTwo(value);
  };

  const handleWidth = ({ target: { value } }) => {
    setWidthtTwo(value);
  };

  const changeWindows = ({ target: { value } }) => {
    setSecondtWindow(value);
  };

  const changeDoors = ({ target: { value } }) => {
    setSecondtDoor(value);
  };

  const handles = {
    handleHeight,
    handleWidth,
    height: heightTwo,
    width: widthtTwo,
  };

  return (
    <form>
      <HeightAndWidth handleFunctions={ handles } />
      <Windows changeWindows={ changeWindows } />
      <Doors changeDoors={ changeDoors } />
      <NextButton />
    </form>
  );
}

export default SecondForm;
